function getRawTweets() {
    // returns all raw data in list form
    return JSON.parse(jsonString)["all"];
}

/**** data cleaning functions ****/

function getCleanedData() {
    allData = {};
    tweets = getRawTweets();

    for (const i in tweets) {
        tweet = tweets[i];
        date = new Date(tweet["date"]);
        dateString = getDateString(date);

        tweetData = {
            cleanDate: date,
            tweetUrl: "https://twitter.com/meganamram/status/" + tweet["tweet_id"],
            likes: tweet["likes"],
            retweets: tweet["retweets"],
            logLikes: Math.log(tweet["likes"]),
            logRTs: Math.log(tweet["retweets"])
        }

        allData[date] = tweetData;
    }
    return allData;
}

function getDateString(date) {
    return date.getFullYear() + "-" + 
           getZeroPaddedNum(date.getMonth() + 1) + "-" + 
           getZeroPaddedNum(date.getDate());
}

function getZeroPaddedNum(num) {
    return num < 10 ? "0" + num : num;
}

/**** constants ****/

var tweets = getCleanedData();
var plotlyFont = { "family": "Open Sans", "color": "#555555" };

var subtitleTemplate = $("#subtitleEventsTemplate").html();
Mustache.parse(subtitleTemplate);

/**** main functionality ****/

function addTimeChart() {
    likesTrace = {
        "type": "lines",
        "x": [],
        "y": [],
        "text": [],
        "line": {color: "rgb(0,191,196)"},
        "name": "Log Likes"
    };
    rtTrace = {
        "type": "lines",
        "x": [],
        "y": [],
        "text": [],
        "line": {color: "rgb(248,118,109)"},
        "name": "Log RTs"
    };    

    for(const dt in tweets) {
        tweet = tweets[dt];

        likesTrace.x.push(tweet["cleanDate"]);
        likesTrace.y.push(tweet["logLikes"]);
        likesTrace.text.push("Number of likes: " + tweet["likes"]);

        rtTrace.x.push(tweet["cleanDate"]);
        rtTrace.y.push(tweet["logRTs"]);
        rtTrace.text.push("Number of retweets: " + tweet["retweets"]);
    }

    plotlyData = [likesTrace, rtTrace];

    plotlyLayout = {
        "font": plotlyFont,
        "title": "Likes and Retweets on TWTDDTFBP Tweets",
        "xaxis": { "font": plotlyFont },
        "yaxis": {
            "title": "Likes and RTs (Log Scale)",
            "font": plotlyFont
        },
        "hovermode": "closest",
        // "margin": { "l": 50, "r": 50, "b": 50, "t": 50 },
        "paper_bgcolor": "rgba(0,0,0,0)", 
        "plot_bgcolor": "rgba(0,0,0,0)",
        "legend": { "xanchor": "center", x: 0.5, orientation: "h" }
        // "xaxis": { "tickangle": 45 }
    };

    Plotly.newPlot("timeChart", plotlyData, plotlyLayout, {"responsive": true});
}

function handlePlotlyClick(eventData) {
    date = new Date(eventData.points[0].x);
    dateString = getDateString(date);
    data = {
        dateString: dateString,
        tweetUrl: tweets[date.toString()]["tweetUrl"],
        events: wiki[dateString]
    };
    if(typeof data["events"] === "undefined" || !data["events"][0]) {
        data["events"] = [];
    }

    $("#timeChartSubtitle").html(Mustache.render(subtitleTemplate, data));
}

addTimeChart();

// add annotation
var timeChart = document.getElementById("timeChart");
timeChart.on("plotly_click", handlePlotlyClick);

